/* SQL import for a Postgresql server */

DROP SCHEMA IF EXISTS JBTRAVEL CASCADE;
CREATE SCHEMA JBTRAVEL;

CREATE SEQUENCE JBTRAVEL.AIRPORT_SEQ;
CREATE TABLE JBTRAVEL.AIRPORT (
	AIRPORTID INTEGER NOT NULL DEFAULT NEXTVAL('JBTRAVEL.AIRPORT_SEQ'),
	AIRPORTNAME VARCHAR(50) NOT NULL,
	AIRPORTCODE VARCHAR(3) NOT NULL,
	CITY VARCHAR(50) NOT NULL,
	STATE_PROV VARCHAR(25),
	COUNTRY VARCHAR(3) NOT NULL,
	LATITUDE DECIMAL(18,15),
	LONGITUDE DECIMAL(18,15),
	PRIMARY KEY (AIRPORTID)
);

CREATE SEQUENCE JBTRAVEL.USER_SEQ;
CREATE TABLE JBTRAVEL.USER (
	USERID INTEGER NOT NULL DEFAULT NEXTVAL('JBTRAVEL.USER_SEQ'),
	FIRSTNAME VARCHAR(35) NOT NULL,
	LASTNAME VARCHAR(35) NOT NULL,
	MIDDLENAME VARCHAR(35) NULL DEFAULT NULL,
	USERNAME VARCHAR(35) NOT NULL,
	PASSWORD VARCHAR(250) NOT NULL,
	EMAILADDRESS VARCHAR(50) NOT NULL,
	PHONENUMBER INTEGER NULL DEFAULT NULL,
	ADDRESS1 VARCHAR(35) NOT NULL,
	ADDRESS2 VARCHAR(35) DEFAULT NULL,
	CITY VARCHAR(25) NOT NULL,
	STATE_PROV VARCHAR(2) NOT NULL,
	ZIP_POST VARCHAR(10) NOT NULL,
	COUNTRY VARCHAR(3) NOT NULL,
	FREQUENTFLYERNUMBER INTEGER NULL DEFAULT NULL,
    D_HOTELS_ID VARCHAR(10) NULL DEFAULT NULL,
    ALAN_RESORTS_ID VARCHAR(10) NULL DEFAULT NULL,
	AGE INTEGER NULL DEFAULT NULL,
	LOYALTYLEVEL VARCHAR(10) NULL DEFAULT NULL,
	PRIMARY KEY (USERID)
);

CREATE SEQUENCE JBTRAVEL.ROUTE_SEQ;
CREATE  TABLE JBTRAVEL.ROUTE  (
  ROUTEID INTEGER NOT NULL DEFAULT NEXTVAL('JBTRAVEL.ROUTE_SEQ'),
  ORIGINAIRPORTID INTEGER NOT NULL ,
  DESTINATIONAIRPORTID INTEGER NOT NULL ,
  DISTANCE INTEGER NOT NULL ,
  PRIMARY KEY (ROUTEID)
);


CREATE SEQUENCE JBTRAVEL.FLIGHT_SEQ;
CREATE  TABLE JBTRAVEL.FLIGHT (
  FLIGHTID INTEGER NOT NULL DEFAULT NEXTVAL('JBTRAVEL.FLIGHT_SEQ'),
  ROUTEID INTEGER NOT NULL ,
  PLANEID INTEGER NOT NULL ,
  FLIGHTNUMBER INTEGER NOT NULL ,
  DEPARTUREDATE TIMESTAMP NOT NULL ,
  ARRIVALDATE TIMESTAMP NOT NULL ,
  SEATSTAKEN INTEGER NOT NULL DEFAULT '0' ,
  PRICE DECIMAL(10,2) NOT NULL DEFAULT '0.00' ,
  FIRSTCLASSPRICE DECIMAL(10,2) NULL DEFAULT NULL ,
  PRIMARY KEY (FLIGHTID)
);

CREATE SEQUENCE JBTRAVEL.RESERVATION_SEQ;
CREATE  TABLE JBTRAVEL.RESERVATION (
  RESERVATIONID INTEGER NOT NULL DEFAULT NEXTVAL('JBTRAVEL.RESERVATION_SEQ'),
  USERID INTEGER NOT NULL ,
  FLIGHTID INTEGER NOT NULL ,
  CHECKEDIN INTEGER NOT NULL DEFAULT '0' ,
  SEATID INTEGER NOT NULL ,
  MEAL VARCHAR(20) NULL DEFAULT 'No Preference' ,
  COMMENT VARCHAR(500) DEFAULT NULL,
  PRIMARY KEY (RESERVATIONID) 
);

CREATE SEQUENCE JBTRAVEL.PLANE_SEQ;
CREATE  TABLE JBTRAVEL.PLANE (
  PLANEID INTEGER NOT NULL DEFAULT NEXTVAL('JBTRAVEL.PLANE_SEQ'),
  PLANEMODEL VARCHAR(35) NOT NULL ,
  TOTALNUMBEROFSEATS INTEGER NOT NULL ,
  TAILNUMBER VARCHAR(15) NOT NULL ,
  PRIMARY KEY (PLANEID) 
);

CREATE SEQUENCE JBTRAVEL.SEAT_SEQ;
CREATE  TABLE JBTRAVEL.SEAT (
  SEATID INTEGER NOT NULL DEFAULT NEXTVAL('JBTRAVEL.SEAT_SEQ'),
  PLANEID INTEGER NOT NULL ,
  SEATNAME VARCHAR(4) NOT NULL ,
  SEATPOSITION VARCHAR(10) NOT NULL ,
  SEATCATEGORY VARCHAR(10) NOT NULL DEFAULT 'Economy' ,
  PRIMARY KEY (SEATID)
);




CREATE TABLE JBTRAVEL.VAL_BILLINGTYPE (
	BILLINGPROVIDER VARCHAR(20) NOT NULL,
	PRIMARY KEY (BILLINGPROVIDER));

CREATE TABLE JBTRAVEL.VAL_MEALTYPE (
  MEAL VARCHAR(20) NOT NULL ,
  PRIMARY KEY (MEAL) );
  
CREATE TABLE JBTRAVEL.VAL_SEATTYPE (
  SEATPOSITION VARCHAR(10) NOT NULL ,
  PRIMARY KEY (SEATPOSITION) );
  
CREATE TABLE JBTRAVEL.VAL_SEATCLASS (
  CLASS VARCHAR(10) NOT NULL ,
  PRIMARY KEY (CLASS) );
  

  
  



ALTER TABLE JBTRAVEL.FLIGHT
    ADD FOREIGN KEY (ROUTEID) 
	REFERENCES JBTRAVEL.ROUTE (ROUTEID)
	ON DELETE CASCADE;
	
ALTER TABLE JBTRAVEL.FLIGHT
    ADD FOREIGN KEY (PLANEID) 
	REFERENCES JBTRAVEL.PLANE (PLANEID)
	ON DELETE CASCADE
	ON UPDATE NO ACTION;


ALTER TABLE JBTRAVEL.SEAT
    ADD FOREIGN KEY (PLANEID) 
	REFERENCES JBTRAVEL.PLANE (PLANEID)
	ON DELETE CASCADE;
	
ALTER TABLE JBTRAVEL.SEAT
    ADD FOREIGN KEY (SEATPOSITION) 
	REFERENCES JBTRAVEL.VAL_SEATTYPE (SEATPOSITION)
	ON DELETE NO ACTION
	ON UPDATE NO ACTION; 
	
ALTER TABLE JBTRAVEL.SEAT
    ADD FOREIGN KEY (SEATCATEGORY) 
	REFERENCES JBTRAVEL.VAL_SEATCLASS (CLASS)
	ON DELETE NO ACTION
	ON UPDATE NO ACTION; 


ALTER TABLE JBTRAVEL.ROUTE
    ADD FOREIGN KEY (DESTINATIONAIRPORTID) 
	REFERENCES JBTRAVEL.AIRPORT (AIRPORTID)
	ON DELETE CASCADE; 

ALTER TABLE JBTRAVEL.ROUTE
    ADD FOREIGN KEY (ORIGINAIRPORTID) 
	REFERENCES JBTRAVEL.AIRPORT (AIRPORTID)
	ON DELETE CASCADE; 
	

ALTER TABLE JBTRAVEL.RESERVATION
    ADD FOREIGN KEY (FLIGHTID) 
	REFERENCES JBTRAVEL.FLIGHT (FLIGHTID)
	ON DELETE CASCADE; 
	
ALTER TABLE JBTRAVEL.RESERVATION
    ADD FOREIGN KEY (SEATID) 
	REFERENCES JBTRAVEL.SEAT (SEATID)
	ON DELETE CASCADE
	ON UPDATE CASCADE;

ALTER TABLE JBTRAVEL.RESERVATION
    ADD FOREIGN KEY (USERID) 
	REFERENCES JBTRAVEL.USER (USERID)
	ON DELETE CASCADE; 	
	
ALTER TABLE JBTRAVEL.RESERVATION
    ADD FOREIGN KEY (MEAL) 
	REFERENCES JBTRAVEL.VAL_MEALTYPE (MEAL)
	ON DELETE NO ACTION
	ON UPDATE NO ACTION;
	
	
	























UPDATE JBTRAVEL.FLIGHT F SET DEPARTUREDATE = F.DEPARTUREDATE+AGE(NOW()::DATE,DATE '2011-06-27');
UPDATE JBTRAVEL.FLIGHT F SET ARRIVALDATE = F.ARRIVALDATE+AGE(NOW()::DATE,DATE '2011-06-27');

DROP SCHEMA IF EXISTS TEST CASCADE;
CREATE SCHEMA TEST;


CREATE TABLE TEST.ADDRESS (
	UID INTEGER NOT NULL,
	STREET VARCHAR(40) NOT NULL,
	CITY VARCHAR(30) NOT NULL,
	STATE_PROV VARCHAR(25) NOT NULL,
	ZIP_POST VARCHAR(10) NOT NULL,
	COUNTRY VARCHAR(25) NOT NULL,
	PRIMARY KEY (UID)
);

CREATE TABLE TEST.PERSON (
	UID INTEGER NOT NULL,
	FIRSTNAME VARCHAR(25) NOT NULL,
	LASTNAME VARCHAR(25) NOT NULL,
	RELATION VARCHAR(25) NOT NULL,
	PRIMARY KEY (UID)
);

CREATE TABLE TEST.RELATION (
	TYPE VARCHAR(25) NOT NULL,
	PRIMARY KEY (TYPE)
);


ALTER TABLE TEST.ADDRESS
	ADD FOREIGN KEY (UID) 
	REFERENCES TEST.PERSON (UID);



ALTER TABLE TEST.PERSON
	ADD FOREIGN KEY (RELATION) 
	REFERENCES TEST.RELATION (TYPE);






